// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import HomePage from './Homepage';
import BMICalculator from './BMICalculator';
import Tracker from './Tracker';
import FitnessSuggestions from './FitnessSuggestions';
import FunctionButtons from './FunctionButtons';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        <nav>
          <Link to="/">Home</Link> | 
          <Link to="/bmi-calculator">BMI Calculator</Link> | 
          <Link to="/tracker">Tracker</Link> | 
          <Link to="/fitness-suggestions">Fitness Suggestions</Link>
        </nav>

        <FunctionButtons 
          onBMIClick={() => window.location.href = '/bmi-calculator'} 
          onTrackerClick={() => window.location.href = '/tracker'} 
          onFitnessClick={() => window.location.href = '/fitness-suggestions'} 
        />
      </div>
    </Router>
  );
}

export default App;
